import { withAppSyncData } from 'next-apollo-appsync'
import awsConfig from '../pages/aws-exports';

const config = {
    url: awsConfig.aws_appsync_graphqlEndpoint,
    region: awsConfig.aws_appsync_region,
    auth: {
        type: awsConfig.aws_appsync_authenticationType,
        // jwtToken: 'eyJraWQiOiJQckxaZTNNTVVmNE5aSFQ5Rk95UVwvdTR2cFFvbmxTQXFLd1FlSHNFcDgrRT0iLCJhbGciOiJSUzI1NiJ9..QMAXsXjBCLfSpJagJMcwhu20Yt5U9FCpncO6ojuVYS2FeB2fOLzvi8wqcny7yi9P1ZuLj_hYXU0CqmufWW-9lCT_e8VJzJdKNQ56YCGjRVhxPGak0WF6Qwfjuoq6XgCFIPv_gIrO1isOKm-siKUVvmx0Vf2lT5dyRO94JxX23BQZTFji9sFk2fUGCdHxBeZqP_lVbvCobO4F1CieBZcVUl0YAgmA4fX7ABmPQGAYOAAiRKwagnUxKsVsqwlLAkd4mP-UoTAXqLNi5-_jX_Z4jUE6AHDcCMy1uusY8gimkvTIKlqDTAUPpJis-YfPb2-_lMoxFEHI8s-LcPgVhKIiCw'
    },
}

export default withAppSyncData(config);
